import { friends } from "./friends"

export const FriendList = () => {
    return <ul className="friend-list">
        {friends.map(e => {
            return <li className="item">
                <span className="status"></span>
                <img className="avatar" src={e.avatar} alt="User avatar" width="48" />
                <p className="name"></p>
            </li>
        })}
    </ul>
}
